message:
Muito orgulho das forças de Segurança do Brasil. Não existe registro que qualquer outro país, como EUA ou Israel que convivem com o terrorismo, tenham tido sucesso em prender mais de 1500 terroristas tão perigosos de uma única vez. Infelizmente o número de detidos caiu drasticamente, por conta da aplicação dos estatutos de proteção ao idoso e da criança, além de algumas gestantes e pessoas com comorbidades graves...
Já com relação aos artefatos de guerra encontrados na posse dos terroristas, segue a relação do que foi inventariado até o momento:
22 cadeiras de rodas;
104 andadores;
305 bengalas;
88 muletas;
25 carrinhos de bebê;
208 pacotes de fraldas;
22 mamadeiras;
31 chupetas
1520 bandeiras nacionais
388 óculos de grau elevado e caixas contendo
Farto medicamento de uso contínuo...
Além de celulares repletos de grupos patrióticos e políticos, bonés nas cores verde e amarelo e alguns ainda contendo símbolos nacionais como bandeiras, além de protetores solar fator 30, 50 e até 60 FPS.
Todo esse material já  foi devidamente catalogado e enviado para ser periciados na importantíssima polícia federal. 🤔🤦🏻‍♂️🙈🙉🙊
